  from discrete sample and profile observations using CTD, bottle and other instruments
  from THOMAS G. THOMPSON in the North Pacific Ocean from 1985-08-04 to 1985-09-07
  (NCEI Accession 0143394)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\":
