  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0143394 includes discrete
  sample and profile data collected from THOMAS G. THOMPSON in the North Pacific Ocean
  from 1985-08-04 to 1985-09-07 and retrieved during cruise TPS47. These data include
  CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DELTA HELIUM-3,
  DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE, NITRITE, Potential temperature
  (theta), SALINITY, Tritium (Hydrogen isotope), WATER TEMPERATURE, phosphate and
  silicate. The instruments used to collect these data include CTD and bottle.nnThese
  data were collected by Lynne Talley and Ray F. Weiss of University of California
  - San Diego; Scripps Institution of Oceanography as part of the WOCE_P01_TPS47 data
  set.nnThe World Ocean Circulation Experiment (WOCE) was a major component of the
  World Climate Research Program with the overall goal of better understanding the
  ocean's role in climate and climatic changes resulting from both natural and anthropogenic
  causes. The CO2 survey took advantage of the sampling opportunities provided by
  the WOCE Hydrographic Program (WHP) cruises during this period between 1990 and
  1998. The final collection covers approximately 23,000 stations from 94 WOCE cruises.\",\n\t\"license_title\":
